日本のライセンスプレートにピッタリのサイズ。<br>
封印部分をカットすればリアにも取り付け可能です。<br>
<br>
装着出来る車種が増えました。<br><br>

※ プラスティック製<br><br>

素材は 2.5ミリ厚のプラスティックです。<br>

ボルト部分に 3ミリの補強がますので、<br>
ボルトの長さが 5.5ミリほど余分に必要になります。 
<br><br>
ライセンス フレームを装着する際、<br>
元々付いているボルトでは長さが足りない場合は<br>
少し長めのステンレス製ボルト <br>
【またはライセンス ボルト】 を使用して下さい。 
<br><br>
サイズ： (H) 約 17.0cm x (W) 約 33.5cm
